import '../App.css'
import principal from '../imagenes/generales/principal.jpg'
import dimenciones from '../imagenes/iconos/dimenciones.png'
import habitaciones from '../imagenes/iconos/habitaciones.png'
import nivel from '../imagenes/iconos/nivel.png'
/*cargamos las propieadades*/


const cargarPropiedades=async (req,res)=>
    { 
            try {
                const objPropiedades= await fetch('https://asesoresguzman.com/api/load',
                    {
                        method:"GET"
                    }
                )

                if (res.ok)
                {
                    return res.json(objPropiedades);
                }


            } catch (error) {
                return res.json(error);
            }

}






export const Propiedad=()=>
{

    return(
        
        <div className='propiedad'>

            <div className='propiedadImagen'>
                <img className='imagenPropiedadImagen' src={principal}/>
            </div>
            <div className='propiedadInfo'>
                <span className='propiedadInfoTipoTVVR'>
                    <span className='propiedadInfoTipoTerrenoVivienda'>vivienda</span>
                    <span className='propiedadInfoTipoVentaRenta'>venta</span>
                </span>
                <span className='propiedadInfoDatos'>
                    <span className='propiedadInfoTituloyUbicacion'><h3>nombrePropiedad</h3><h4>ubicacion actual de la propiedad</h4></span>
                    <span className='propiedadInfoDatosCuartos'>
                        <span className='propiedadInfoHabitaciones'><label>2</label><img class='iconoPropiedad' src={habitaciones}></img></span>
                        <span className='propiedadInfoNiveles'><label>3</label><img class='iconoPropiedad' src={nivel}></img></span>
                        <span className='propiedadInfoArea'><label>500mt</label><img class='iconoPropiedad' src={dimenciones}></img></span>
                    </span>

                </span>

            </div>
            <div className='propiedadDetalles'>
                <h3>costo</h3>
            </div>
        </div>
    )

}
